%spark2.spark
import org.apache.spark.sql.DataFrame
import org.apache.spark.ml.feature.{StandardScaler, VectorAssembler, Normalizer}

def filterPlayers(ds: Dataset[Player]): Dataset[Player] = {
    val filterdPlayers = ds.filter(d => (d.player_dist_ride != 0 || d.player_dist_walk != 0)
      && d.player_survive_time <= 2400
      && d.team_placement > 0)
    filterdPlayers
  }

def dropCols(df: DataFrame): DataFrame = {
    df.drop("date","game_size","match_id","match_mode","party_size","player_name","team_id")
  }

object Clustering {

  def createDfWithFeature(ds: Dataset[Player],inputCols: Array[String]): DataFrame = {
    val vecAss = new VectorAssembler().setInputCols(inputCols).setOutputCol("unscaled_features")
    val assembledDf = vecAss.transform(ds)
    val scaler = new StandardScaler().setInputCol("unscaled_features").setOutputCol("features")
    val scalerModel = scaler.fit(assembledDf)
    val scaledDf = scalerModel.transform(assembledDf)
    dropCols(scaledDf)
  }
}


object Classification {
  def createDfWithFeature(ds: Dataset[Player]): DataFrame ={
    val isWinnerUdf = udf((placement: Int) => placement match {
      case 1 => 1
      case _ => 0
    })
    val colArray = Array("player_assists", "player_dbno", "player_dist_ride", "player_dist_walk", "player_dmg", "player_kills", "player_survive_time")
    val vecAss = new VectorAssembler().setInputCols(colArray).setOutputCol("feature_unnormalized")
    val normalizer = new Normalizer().setInputCol("feature_unnormalized").setOutputCol("features")
    val df_temp_1 = vecAss.transform(ds)
    val df_temp_2 = normalizer.transform(df_temp_1)
    df_temp_2.withColumn("survived", isWinnerUdf(df_temp_2("team_placement")))
  }
}

  val filteredDS = filterPlayers(ds)
  val soloPlayers = filteredDS.filter(d => d.party_size == 1).cache()
  val duoPlayers = filteredDS.filter(d => d.party_size == 2).cache()
  val squadPlayers = filteredDS.filter(d => d.party_size == 4).cache()
